    return (
        <div>
            <Box sx={{ pb: 7 }} ref={ref}>
            <CssBaseline />
                <Paper sx={{ position: 'fixed', bottom: 0, left: 0, right: 0 }} elevation={3}>
                    <BottomNavigation
                        showLabels
                        value={value}
                        onChange={(event, newValue) => {
                            setValue(newValue);
                        }}
                    >
                        <BottomNavigationAction label="PROFILE" onClick={showProfilePage} />
                        <BottomNavigationAction label="PLAY" icon={<FavoriteIcon />} />
                        <BottomNavigationAction label="SETTINGS" icon={<ArchiveIcon />} />         
                    </BottomNavigation>
                </Paper>
            </Box>
            <Routes>
                <Route path="/" element={<PlayPage/>} />
                <Route path="/play" element={<PlayPage/>} />
